import React from "react";

const NewsContainer = (props) => {
    return(
        <div className="row">
            <div className="col-lg-6">
                <div className="news-container" style={{backgroundImage: `url(${props.urlToImage})`}}>
                    <h2>{props.title}</h2>
                    <p>{props.description}</p>
                    <a href={props.url} className="icon-link gap-1 icon-link-hover stretched-link">
                        Continue reading...
                    </a>
                </div>
            </div>   
        </div>
    );
};

export default NewsContainer;
